import User from "./User";
import './App.css';

function App(){
    let users =[
        {name:'ali', age:22, height:170},
        {name:'paras' ,age:28 ,height:160},
        {name:'milad' , age:25, height:28}
    ]
    return(
        <div className="row">
            <User {...users[0]} />
            <User {...users[1]} />
            <User {...users[2]}  />
           
            

        </div>
    )
}
export default App
